import React from 'react';
import { Card } from 'react-bootstrap';

const clients = [
    {
        name:"Al Amin",
        profession:"Army",
        img:"../../../../images/Ellipse 1.png",
        text:"Lorem ipsum dolor sit amet consectetur adipisicing elit. Totam dolor tenetur illum, officiis omnis voluptate dolores et a voluptates corporis?"
    },
    {
        name:"Fahim",
        profession:"Army",
        img:"../../../../images/Ellipse 2.png",
        text:"Lorem ipsum dolor sit amet consectetur adipisicing elit. Totam dolor tenetur illum, officiis omnis voluptate dolores et a voluptates corporis?"
    },
    {
        name:"Sakib",
        profession:"Army",
        img:"../../../../images/Ellipse 3.png",
        text:"Lorem ipsum dolor sit amet consectetur adipisicing elit. Totam dolor tenetur illum, officiis omnis voluptate dolores et a voluptates corporis?"
    }
];

const Testimonial = () => {
    return (
        <div>
            <div>
                <h1>Testimonial</h1>
                <h2>What our clients say about our services!</h2>

            </div>
            <div className="d-flex p-2 justify-content-center">
                {
                    clients.map((client) => <Card style={{width:"18rem", margin:"2em"}}>
                        <p>{client.text} </p>
                   
                        </Card>)
                }
            </div>
        </div>
    );
};

export default Testimonial;
